import React, {Component} from 'react';
import {Nav,Button} from 'react-bootstrap';
import './CustomNav.css';
export default class CustomNavBar extends Component{
    render(){
        return( 
            <navbar>
 <div className="cover-container d-flex w-100 h-100 p-1 mx-auto ">
    <header className="masthead">
    
    <div class="inner">
      <h3 className="masthead-brand" >MSM</h3>
      <nav className="nav nav-masthead justify-content-center">
      <Nav.Link className="nav-link" href="/">Home</Nav.Link>
      <Nav.Link href="/profile">Profile</Nav.Link>
      <Nav.Link href="/contactus">Contact Us</Nav.Link>
      <Nav.Link href="/about" className="mr-1">About</Nav.Link>
      <Button variant="outline-light" size="sm" href="/signup">Sign Up</Button>
      <Button variant="primary" size="sm">Login</Button>
      </nav>
    </div>
     </header>
</div>
</navbar>      
)
    }
}
